import React from 'react'
import SearchComponent from '../components/SearchComponent'
import { useNavigate  } from 'react-router-dom'

const Home = (props) => {

  const navigate = useNavigate();

  const onClickSearch = (TextToSearch) => {
    navigate(`/items?search=${TextToSearch}`)
  }

  return (
    <div className='m-o vh-100 row justify-conten-center align-items-center'>
      <div className='col-auto bg-danger p-5 text-center'>
        <SearchComponent onClickSearch={onClickSearch} />
      </div>
    </div>
  )
}

export default Home
